在出生後的一段時間內，牠會吸收背上種子裡儲存著的營養成長。`},{src:pm,alt:"妙蛙草",type:"草屬性",description:`
沐浴在陽光下越久，身體內會湧出越多力量，背上的花苞也會漸漸成長。`},{src:Wu,alt:"妙蛙花",type:"草屬性",description:`
由於能將沐浴的陽光轉換成能量，夏天會變得更強。`},{src:dm,alt:"妙蛙花EX",type:"草屬性",description:`
每當張開大大的花瓣沐浴在陽光之下時，身體就會變得充滿活力。`},{src:fm,alt:"綠毛蟲",type:"草屬性",description:`
會從頭部的觸角釋放出強烈的氣味來趕走敵人，藉此保護自己。`},{src:mm,alt:"鐵甲蛹",type:"草屬性",description:`
正處於等待進化的狀態。除了變硬之外什麼都做不了，只能動也不動以免遭受攻擊。`},{src:Qu,alt:"巴大蝶",type:"草屬性",description:`
當牠飛快地拍動翅膀，帶有劇毒的鱗粉就會隨著風向這裡飄過來。`},{src:gm,alt:"獨角蟲",type:"草屬性",description:`
有著非常靈敏的嗅覺。能用大大的紅鼻子聞出自己喜歡吃和不喜歡吃的葉子。`},{src:hm,alt:"鐵殼蛹",type:"草屬性",description:`
雖然掛在樹上幾乎一動也不動，但體內正為了進化而忙碌準備著。證據就是牠的身體會變得很熱。`},{src:ym,alt:"大針蜂",type:"草屬性",description:`
大針蜂非常重視自己的地盤，為了安全起見，最好不要接近牠的住處。一旦生氣就會成群結隊襲擊而來。`},{src:vm,alt:"走路草",type:"草屬性",description:`
別名謎行草。據說每到夜裡，牠會用２條根走上長達３００公尺的距離。`},{src:km,alt:"臭臭花",type:"草屬性",description:`
從口中緩緩滲出的不是口水，而是類似花蜜的汁液，被牠用來引誘獵物接近。`},{src:_m,alt:"霸王花",type:"草屬性",description:`
當花苞隨著「砰！」的聲響綻放後，就會開始散播能引起過敏反應的毒花粉。`},{src:Pm,alt:"派拉斯",type:"草屬性",description:`
控制蟲子的是一種叫做冬蟲夏草的蕈類。蟲子的意志會被忽視。`},{src:xm,alt:"派拉斯特",type:"草屬性",description:`
本體是背上的蘑菇，底下的蟲子幾乎已經死亡。一旦蘑菇脫落，牠就再也不會動了。`},{src:Cm,alt:"毛球",type:"草屬性",description:`
全身上下都會滲出毒素。天黑後就會去捕捉聚在燈光處的小型蟲寶可夢。`},{src:Gm,alt:"摩魯蛾",type:"草屬性",description:`
翅膀上附著鱗粉，每次翩翩拍動翅膀，就會散播劇毒的粉末。`},{src:wm,alt:"喇叭芽",type:"草屬性",description:`
只要周圍有會動的東西，不論何時都會立即作出反應，將細細的藤蔓伸往該處去。`},{src:Sm,alt:"口呆花",type:"草屬性",description:`
葉子部分會變成刀刃斬斷對手。還會從口中吐出可融化萬物的液體。`},{src:Xu,alt:"大食花",type:"草屬性",description:`
一旦被如花蜜般的香氣吸引到牠的口中，便是死路一條。下場是被溶解液溶化掉。`},{src:Tm,alt:"蛋蛋",type:"草屬性",description:`
會發出只有蛋蛋才能收到的心靈感應，因此不論何時都能６隻聚集在一起。`},{src:Im,alt:"椰蛋樹",type:"草屬性",description:`
被稱為會走路的熱帶雨林。每個果實都有自己的臉，而且各有各的思想。`},{src:Em,alt:"椰蛋樹EX",type:"草屬性",description:`
聽說在極少數的情況下，當其中一顆頭掉落到地面，就會變成蛋蛋並且動起來。`},{src:Am,alt:"蔓藤怪",type:"草屬性",description:`
被敵人抓住時藤蔓會斷開。因為完全不會痛，所以牠會趁那個空檔逃走。藤蔓在第二天就會重新長好。`},{src:jm,alt:"飛天螳螂",type:"草屬性",description:`
會用鋒利的鐮刀割開草叢前進。因為動作實在太快，甚至無法用肉眼看清。`},{src:Nm,alt:"凱羅斯",type:"草屬性",description:`
雖然很強壯，但弱點是怕冷。到了晚上就會把身體埋在樹葉堆裡睡覺。`},{src:Lm,alt:"木棉球",type:"草屬性",description:`
使用木棉球吐出的棉花製作而成的枕頭和被褥是又輕又透氣的高級商品。`},{src:Dm,alt:"風妖精",type:"草屬性",description:`
無論是多麼窄小的縫隙，都能像風兒般地穿過。會留下白色的毛球。`},{src:Rm,alt:"百合根娃娃",type:"草屬性",description:`
頭上的葉子就算掉了也會立刻長回來。葉子味道很苦，但拿來嚼卻能瞬間恢復精神。`},{src:zm,alt:"裙兒小姐",type:"草屬性",description:`
頭上的花飾會散發出聞了就能舒緩情緒的香氣，但卻極為難以照料。`},{src:Om,alt:"坐騎小羊",type:"草屬性",description:`
